.eqv	BLACK	0x00000000


.eqv INPUT_AVAILABLE, 0xffff0000
.eqv INPUT_VALUE, 0xffff0004

.eqv PLAYER_HEIGHT, 50
.eqv PLAYER_WIDTH, 40

